import React from 'react';

interface Props {
  link: string;
}

function CarouItem({ link }: Props) {

  const itemS: React.CSSProperties = {
    backgroundImage: link,
    width: '100vw',
    height: '100vh',
  };


  return (<>
    <div style={itemS}>

    </div>
  </>);
}
export default CarouItem;
